import React, { Component } from 'react'
import "./index.css"
export default class Search extends Component {
    render() {
        return (
            <div>
                <section className="jumbotron">
				<h3 className="jumbotron-heading">search git User</h3>
				<div>
					<input  type="text" placeholder="输入关键词点击搜索"/>&nbsp;
					<button >搜索</button>
				</div>
			</section>
            </div>
        )
    }
}
